import React, { useEffect } from 'react';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableRow from '@material-ui/core/TableRow';
import CheckCircleIcon from '@material-ui/icons/CheckCircle';
import CancelIcon from '@material-ui/icons/Cancel';
import Button from '@material-ui/core/Button';
import { useDispatch, useSelector } from 'react-redux';
import { getInvoiceLoads } from '../../actions/load';

export default function Invoices({ showWizardFor }) {
    const dispatch = useDispatch();
    const invoices = useSelector(state => state.load.invoices.data);
    useEffect(() => {
        dispatch(getInvoiceLoads());
    }, []);
    return (<TableBody>
        { invoices.map(({
            _id, loadNumber, brokerage, rate, proofDelivery, rateConfirmation
        }) => (<TableRow>
            <TableCell align="center">{ loadNumber }</TableCell>
            <TableCell align="center">{ brokerage ? brokerage : '--' }</TableCell>
            <TableCell align="center">{ rate ? rate : '--' }</TableCell>
            <TableCell align="center">
                { 
                    Array.isArray(rateConfirmation) && rateConfirmation.length > 0 && typeof rateConfirmation[0] !== 'string'  ? 
                    <CheckCircleIcon style={{color: 'green'}} />
                    : <CancelIcon style={{color: 'red'}} /> 
                }
            </TableCell>
            <TableCell align="center">
                { 
                    Array.isArray(proofDelivery) && proofDelivery.length > 0 && typeof proofDelivery[0] !== 'string' ? 
                    <CheckCircleIcon style={{color: 'green'}} /> 
                    : <CancelIcon style={{color: 'red'}} /> 
                }
            </TableCell>
            <TableCell align="center">
                <Button 
                variant="contained" 
                color="primary"
                onClick={()=>showWizardFor({_id, loadNumber, brokerage, rate, proofDelivery, rateConfirmation})}>
                    Invoice
                </Button>
            </TableCell>
        </TableRow>)) }
    </TableBody>);
}
